import React from 'react';
import AboutMeetup from '../organisms/AboutMeetup';
import Footer from '../organisms/Footer';
import MeetupNow from '../organisms/MeetupNow';
import Members from '../organisms/Members';
import NextMeetup from '../organisms/NextMeetup';
import PastMeetups from '../organisms/PastMeetups';

const Home = () => {
	return (
		<div className='w-full text-white'>
			<MeetupNow />
			<NextMeetup />
			<AboutMeetup />
			<Members />
			<PastMeetups />
			<Footer />
		</div>
	);
}

export default Home;
